script: |
  super -f text -I q1696.spq | sort > q1696.out

inputs:
  - name: q1696.spq
    data: |
      SELECT DISTINCT + col0 * - ( + ( - col2 ) ) - - + 94 + col1 + col1 + col1 AS col0, ( - col2 ) AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q1696.out
    data: |
      5032	-96
      5124	-59
      6423	-68
